import React from 'react';

const Home = () => {
  return (
    <div className="bg-[#0f1115] text-white min-h-screen flex flex-col items-center justify-center px-4">
      <p className="text-indigo-400 text-sm md:text-base mb-2">Restricted by opportunities?</p>
      <h1 className="text-3xl md:text-5xl font-extrabold text-center mb-4">
        Get the tech career<br /> you deserve. Faster.
      </h1>
      <p className="text-gray-400 text-center max-w-xl mb-6">
        Structured coding courses that get you there faster with confidence.
      </p>
      <button className="bg-orange-500 hover:bg-orange-600 text-white px-6 py-3 rounded font-semibold transition">
        Explore offerings
      </button>
    </div>
  );
};

export default Home;
